// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home';
import About from './pages/About';
import UserHomePage from './pages/UserHomePage';
import LostItems from './pages/LostItems'; // You can create these pages
import FoundItems from './pages/FoundItems'; 
import Others from './pages/Others';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/about" element={<About />} />
          <Route path="/user-home" element={<UserHomePage />} />
          <Route path="/category/lost-items" element={<LostItems />} />
          <Route path="/category/found-items" element={<FoundItems />} />
          <Route path="/category/others" element={<Others />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
